import React, { useState, useEffect } from "react";
import axios from "axios";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";

import CustomCard from "../components/CustomCard";
const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    marginLeft: "24px"
  },
  test: {
    marginLeft: "24px",
    marginRight: "24px"
  },
  card: {
    backgroundColor: "red",
    margin: "24px",
    padding: theme.spacing(2)
  }
}));
function Develop() {
  const classes = useStyles();
  const { contents, useContents } = useState([]);

  return (
    <Grid container>
      <CustomCard
        xs={12}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
      ></CustomCard>{" "}
      <CustomCard
        xs={4}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
        width="33%"
        height="33%"
      ></CustomCard>
      <CustomCard
        xs={4}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
        width="33%"
        height="33%"
      ></CustomCard>
      <CustomCard
        xs={4}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
        width="33%"
        height="33%"
      ></CustomCard>
      <CustomCard
        xs={6}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
        width="50%"
        height="50%"
      ></CustomCard>
      <CustomCard
        xs={6}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
        width="50%"
        height="50%"
      ></CustomCard>
    </Grid>
  );
}

export default Develop;
